import {Input, Menu} from 'semantic-ui-react';

const Filter = ({changeFilter, filterBy}) => {
console.log(filterBy)
    return (
      <Menu secondary>
            <Menu.Item name='home'  onChange={changeFilter('home')} />
            <Menu.Item
            name='messages'
            
            />
            <Menu.Item
            name='friends'
            active={'friends'=== 'friends'}
            
            />
            <Menu.Menu position='right'>
            <Menu.Item>
                <Input icon='search' placeholder='Search...' />
            </Menu.Item>
            <Menu.Item
                name='logout'
                
            />
            </Menu.Menu>
      </Menu>
    )
}

export default Filter;
